import { useState } from "react";

function Users(){
    const [employeeObj,setEmployeeObj]= useState("1")
    let someName = "1"

    function handleUseStates(e){
        e.preventDefault();
        someName="2"
        setEmployeeObj("2")
    } 

    return(
        <>
            {someName}
            <br/>
            {employeeObj}
            <button onClick={handleUseStates}> ClickMe</button>
        </>
    )

}

export default Users;
